import React, { useState } from 'react';

export default function ContactsView({ contacts }) {
  const [showAllData, setShowAllData] = useState(true);

  function toggleData() {
    setShowAllData(!showAllData); // Toggle showAllData state
  }

  // Render contacts with optional number based on showAllData state
  return (
    <>
      <div>
        {contacts.map((contact, index) => (
          <div key={index}>
            {showAllData ? (
              <p>{contact.name}, {contact.number}, {contact.age}</p>
            ) : (
              <p>{}</p>
            )}
          </div>
        ))}
      </div>
      <button onClick={toggleData}>Toggle Data</button>
    </>
  );
}
